class Solution(object):    def topKFrequent(self, nums, k):        """        :type nums: List[int]        :type k: int        :rtype: List[int]        """        dict1={}        for i in range(len(nums)):            if nums[i] not in dict1:                dict1[nums[i]]=1            else:                dict1[nums[i]]+=1        ans=[]        for j in range(k):            key = max(dict1, key=dict1.get)            ans.append(key)            dict1[key]=0        return ansnums=[1,1,1,2,2,3]k=2s=Solution()print(s.topKFrequent(nums,k))#分两种情况，奇数偶数